#include <stdio.h>
#include <string.h>
#include <stdlib.h>
#include <unistd.h>

void parseurl(char *argv)
{
	char *host;
	char *type;
	char *page;

	type = host = page = argv;
	
	if ((host = strstr(argv, "://")))
	{
		*host = '\0';
		host += 3;
	}
	if ((page = strstr(host, "/")))
		*page++ = '\0'; 

	printf("Attempting an [%s] protocol on [%s] to retrieve [%s]\n", type, host, page);
	
	return;
}

